                        <Route exact path='/' component={Home}/>
                        {/*<Route path='/problem' component={Problems}/>
                        <Route path='/compare_problems'  component={Compare}/>*/}
                    </Switch>
                 </div>
            </BrowserRouter>
  )
 }
};

export default App;
